# Import necessary libraries for Ridge Regression and Standardization
from sklearn.linear_model import Ridge
from sklearn.preprocessing import StandardScaler

# Feature scaling (Standardization)
scaler = StandardScaler()
X_scaled = scaler.fit_transform(X)

# Splitting the data into training and testing sets (scaled)
X_train_scaled, X_test_scaled, y_train_scaled, y_test_scaled = train_test_split(X_scaled, y, test_size=0.2, random_state=42)

# Train Ridge Regression model
ridge_model = Ridge(alpha=1.0)
ridge_model.fit(X_train_scaled, y_train_scaled)

# Predicting and evaluating the Ridge model
y_pred_ridge = ridge_model.predict(X_test_scaled)

# Evaluate the Ridge model
mse_ridge = mean_squared_error(y_test_scaled, y_pred_ridge)
r2_ridge = r2_score(y_test_scaled, y_pred_ridge)

print("\nRidge Regression Model Performance:")
print(f"Mean Squared Error (Ridge): {mse_ridge}")
print(f"R-squared (Ridge): {r2_ridge}")

# Compare with the basic linear regression model's performance
print(f"Comparison with Linear Regression:\nRidge R^2: {r2_ridge} vs Linear R^2: {r2}")

"""# Analyze overfitting or underfitting"""

if r2_ridge > r2:
    print("The Ridge model appears to perform better, reducing overfitting.")
else:
    print("The Ridge model does not show significant improvement, suggesting potential underfitting.")

